// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const navStyle = {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '1rem 2rem',
    backgroundColor: '#282c34',
    color: '#fff'
  };

  const brandStyle = {
    fontSize: '1.5rem',
    fontWeight: 'bold'
  };

  const linkContainerStyle = {
    display: 'flex',
    gap: '1.5rem'
  };

  const linkStyle = {
    color: '#fff',
    textDecoration: 'none',
    fontWeight: '500',
    transition: 'color 0.3s ease'
  };

  return (
    <nav style={navStyle}>
      <div style={brandStyle}>DAA Project</div>
      <div style={linkContainerStyle}>
        <Link to="/" style={linkStyle}>Intro</Link>
        <Link to="/algo/1" style={linkStyle}>Algorithm 1</Link>
        <Link to="/algo/2" style={linkStyle}>Algorithm 2</Link>
        <Link to="/algo/3" style={linkStyle}>Algorithm 3</Link>
      </div>
    </nav>
  );
};

export default Navbar;
